<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">
<html xmlns="http://www.w3.org/1999/xhtml"
			xmlns:wicket="http://git-wip-us.apache.org/repos/asf/wicket/repo?p=wicket.git;a=blob_plain;f=wicket-core/src/main/resources/META-INF/wicket-1.5.xsd;hb=master"
			xml:lang="en"
			lang="en">
<wicket:extend>
    <div class="print-container short-form">
        <div class="printbar">
            <img onclick="window.print();" class="printIcon" wicket:id="printIcon"/>
            <p   onclick="window.print();">Print page</p>
        </div>
        <div class="print-page source">
            <img class="watermark" wicket:id=watermarkImage/>
            <header class="page-header">
                <div wicket:id="meta" class="data-container-revision-and-points"/>
                <div wicket:id="assetpage" class="data-container-asset-info"/>
            </header>
            <ul class="page-content">
                <div wicket:id="productsummary" class="data-container-caution"/>
                <div wicket:id="applicationProcess"/>
                <div wicket:id="images"/>
                <div wicket:id="list"/>
                <div wicket:id="testingAndVerification"/>
                <div wicket:id="removalProcess"/>
            </ul>
            <footer class="page-footer">
                <div wicket:id="footer"/>
            </footer>
        </div>
    </div>
</wicket:extend>
</html>
